Oberwesel station is on the West Rhine Railway (German: Linke Rheinstrecke) between Koblenz and Mainz in the UNESCO World Heritage Site of the Upper Middle Rhine Valley in the German state of Rhineland-Palatinate. The station is classified by Deutsche Bahn as a category 5 station. It is in the southern part of the town of Oberwesel and is served by Regional-Express services operated by Deutsche Bahn and Regionalbahn trains operated by trans regio Deutsche Regionalbahn.

This film features passing passenger and freight traffic as well as light engine movements at Oberwesel Station, it is filmed from both the Railway Station and Schönburg, a castle above Oberwesel. 

