The Honda NC700X is a good commuter bike. It's nimble, quick, adequately powered, and touts excellent fuel economy. Plus it has on board storage. It's a solid choice. New riders should beware, though, because each plus comes with a minus. Adequate power isn't the same as powerful. The 670 cc engine only puts out 49-51 HP (compare that to a Ninja 650R which comes in around 70 HP). Nimble isn't the same as sporty. It's not too long before you're begging for more than the NC700X can deliver.

